import React from "react";
import "./styles.css";
import strings from "./strings";
import logoImg from "../../Assets/UncutLogo.png";

export default function Footer() {
  return (
    <div id="footer-wrapper">
      <img src={logoImg} alt={strings.logoAlt} />
      <div>Copyright</div>
      <div>Facebook</div>
      <div>LinkedIn</div>
      <div>Phone</div>
    </div>
  );
}
